}

}

}

  colorrange = d3.range(20).map(function() { return d3.interpolateRgb("pink", "blue")(Math.random()); });
}

  .append("g")
    .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

var graph = d3.csv(csvpath, function(data) {
  data.forEach(function(d) {
    d.date = format.parse(d.date.trim());
    d.value = +(d.value.trim());
    d.expansion = d.expansion;
  });

  var layers = stack(nest.entries(data));

  x.domain(d3.extent(data, function(d) { return d.date; }));
  y.domain([0, d3.max(data, function(d) { return d.y0 + d.y; })]);

  svg.selectAll(".layer")
      .data(layers)
    .enter().append("path")
      .attr("class", "layer")
      .attr("d", function(d) { return area(d.values); })
      .style("fill", function(d, i) { return z(i); });


  svg.append("g")
      .attr("class", "x axis")
      .attr("transform", "translate(0," + height + ")")
      .call(xAxis);

  svg.append("g")
      .attr("class", "y axis")
      .attr("transform", "translate(" + width + ", 0)")
      .call(yAxis.orient("right"));

  svg.append("g")
      .attr("class", "y axis")
      .call(yAxis.orient("left"));
  svg.append("text")
      .attr("x", (width / 2))             
      .attr("y", 0 - (margin.top / 2))
      .attr("text-anchor", "middle")  
      .style("font-size", "16px") 
      .style("text-decoration", "underline")  
      .text(data_dict[csvpath][1]);
  //opacity of each layer.
  var invertedx_old = 0
  svg.selectAll(".layer")
    .attr("opacity", 1)
    .on("mouseover", function(d, i) {
      svg.selectAll(".layer").transition()
      .duration(1000)
      .attr("opacity", function(d, j) {
        return j != i ? 0.6 : 1;
    })})
    
    //mousemove and show layer name
    .on("mousemove", function(d, i) {
      mousex = d3.mouse(this);
      mousex = mousex[0];
      invertedx_old = x.invert(mousex);
      invertedx_old = invertedx_old.getFullYear().toString() + "-" + (invertedx_old.getMonth() + 1).toString() + "-" + invertedx_old.getDate().toString()
      var invertedx = x.invert(mousex);
      invertedx = parseInt(invertedx.getFullYear().toString() + invertedx.getMonth().toString() + invertedx.getDate().toString());
      var selected = (d.values);
      for (var k = 0; k < selected.length; k++) {
        datearray[k] = selected[k].date
        datearray[k] = parseInt(datearray[k].getFullYear().toString() + datearray[k].getMonth().toString() + datearray[k].getDate().toString());
      }

      mousedate = datearray.indexOf(invertedx);
      pro = d.values[mousedate].value;
      expansion = d.values[mousedate].expansion;

      d3.select(this)
      .classed("hover", true)
      .attr("stroke", strokecolor)
      .attr("stroke-width", "0.5px"), 
            //tooltip.html( "<p>" + d.key + "<br>" + pro + "<br>" + invertedx_old + "<br>" + expansion + "</p>" ).style("visibility", "visible");
            //tooltip.html( "<p>" + d.key + "<br>" + pro + "<br>" + invertedx_old + "</p>" ).style("visibility", "visible");
            tooltip.html( "<p>" + d.key + "<br>" + invertedx_old + "<br>" + expansion + "</p>" ).style("visibility", "visible");
      
    })
    .on("mouseout", function(d, i) {
     svg.selectAll(".layer")
      .transition()
      .duration(250)
      .attr("opacity", "1");
      d3.select(this)
      //d3.select("a" + "#id")
      .classed("hover", false)
            //.attr("stroke-width", "0px"), tooltip.html( "<p>" + d.key + "<br>" + pro + "<br>" + invertedx_old + "<br>" + expansion+ "</p>" ).style("visibility", "hidden");
            //.attr("stroke-width", "0px"), tooltip.html( "<p>" + d.key + "<br>" + pro + "<br>" + invertedx_old +  "</p>" ).style("visibility", "hidden");
            .attr("stroke-width", "0px"), tooltip.html( "<p>" + d.key + "<br>"  + invertedx_old + "<br>" + expansion+ "</p>" ).style("visibility", "hidden");
  })
    
  //This is for the vertical line.
  var vertical = d3.select(data_dict[csvpath][2])
        .append("div")
        .attr("class", "remove")
        .style("position", "absolute")
        .style("z-index", "19")
        .style("width", "2px")
        .style("height", "380px")
        .style("top", "10px")
        .style("bottom", "30px")
        .style("left", "0px")
        .style("background", "#fff");

  d3.select(data_dict[csvpath][2])
      .on("mousemove", function(){  
         mousex = d3.mouse(this);
         mousex = mousex[0] + 2;
         vertical.style("left", mousex + "px" )})
      .on("mouseover", function(){  
         mousex = d3.mouse(this);
         mousex = mousex[0] + 2;
         vertical.style("left", mousex + "px")});
});
}
</script>
</body></html>
